import { SET_ACCESS_TOKEN, SET_PROFILE, SET_USER } from "./actions";

export const setUser = (payload) => ({
  type: SET_USER,
  payload,
});

export const setAccessToken = (payload) => ({
  type: SET_ACCESS_TOKEN,
  payload,
});

export const setProfile = (payload) => ({
  type: SET_PROFILE,
  payload,
});
